styles:
mdl-dialog-host-component {
  width: fit-content;
  height: fit-content;
  padding: 1em;
  background: white;
  color: black;
  opacity: 1;
  visibility: hidden;
  display: block;
  position: fixed;
  margin: auto;
  left: 0;
  right: 0;
  transition: all;
  top: 50%;
  transform: translate(0, -50%);
}

mdl-dialog-host-component.open {
  visibility: visible;
}

.dialog-backdrop {
  position: fixed;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  background: rgba(0, 0, 0, 0.1);
}
